import React from 'react';
// import './Contact.css';

const Contact = () => {
  return (
    <section id="contact">
    <p class="hi">Let's work together...</p>
    <p>How do you take your coffee?</p>
    <div class="contact-links">

        <a href="https://facebook.com/Arwa Zakria" target="_blank" class="btn contact-details "><i
                class="fab fa-facebook-square"></i> Facebook</a>
        <a id="profile-link" href="https://github.com/ArwaZ65" target="_blank" class="btn contact-details"><i
                class="fab fa-github"></i> GitHub</a>
        <a href="https://x.com/ArwaZakria1?t=yg0dDQuNF-mo9cIaliLX1g&s=09" target="_blank"
            class="btn contact-details"><i class="fab fa-twitter"></i> Twitter</a>
        <a href="mailto:arwazakria2003@gmail.com" class="btn contact-details"><i class="fas fa-at"></i> Send a
            mail</a>
        <a href="tel:001279046015" class="btn contact-details"><i class="fas fa-mobile-alt"></i> Call me</a>
    </div>

</section>
  );
};

export default Contact;
